import React from "react";
import { Box, Container, Grid } from "@mui/material";

export const Logo = ({ logo }) => {
  return (
    <Grid
      item
      direction={"column"}
      alignItems={"center"}
      justifyContent={"space-evenly"}
      sx={{
        mt: 5,
        mb: 5,
        minHeight: "10vh",
      }}
    >
      <Box>
        <img src={logo} height={"auto"}  alt="logoUdeA" />
      </Box>
    </Grid>
  );
};
